import SeeAll from "../seeAll/SeeAll";
import "./genresComponent.scss";

const GenresComponent = () => {
  return (
    <div className="c-genres  h-component">
      <div className="top">
        <h3 className="c-title">Genres</h3>
        <SeeAll pageLink={"/genres"} />
      </div>
    </div>
  );
};

export default GenresComponent;
